运行这个示例: 克隆这个 示例 仓库: git clone git@github.com:alloy-rs/examples.git 运行: cargo run --example deploy_from_bytecode //! Example of deploying a contract at runtime from Solidity bytecode to Anvil and interacting with
//! it. use alloy::{ hex, network::{EthereumWallet, ReceiptResponse, TransactionBuilder}, node_bindings::Anvil, primitives::U256, providers::{Provider, ProviderBuilder}, rpc::types::TransactionRequest, signers::local::PrivateKeySigner, sol,
};
use eyre::Result; // If you have the bytecode known at build time, use the `deploy_from_contract` example.
// This method benefits from using bytecode at runtime, e.g., from newly deployed contracts, to
// analyze the behavior.
sol! { #[allow(missing_docs)] #[sol(rpc)] contract Counter { uint256 public number; function setNumber(uint256 newNumber) public { number = newNumber; } function increment() public { number++; } }
} #[tokio::main]
async fn main() -> Result<()> { // Spin up a local Anvil node. // Ensure `anvil` is available in $PATH. let anvil = Anvil::new().try_spawn()?; // Set up signer from the first default Anvil account (Alice). let signer: PrivateKeySigner = anvil.keys()[0].clone().into(); let wallet = EthereumWallet::from(signer); println!("Anvil running at `{}`", anvil.endpoint()); // Create a provider with the wallet. let rpc_url = anvil.endpoint().parse()?; let provider = ProviderBuilder::new().with_recommended_fillers().wallet(wallet).on_http(rpc_url); // Deploy the `Counter` contract from bytecode at runtime. let bytecode = hex::decode( // solc v0.8.26; solc Counter.sol --via-ir --optimize --bin "" )?; let tx = TransactionRequest::default().with_deploy_code(bytecode); // Deploy the contract. let receipt = provider.send_transaction(tx).await?.get_receipt().await?; let contract_address = receipt.contract_address().expect("Failed to get contract address"); let contract = Counter::new(contract_address, &provider); println!("Deployed contract at address: {}", contract.address()); // Set number let builder = contract.setNumber(U256::from(42)); let tx_hash = builder.send().await?.watch().await?; println!("Set number to 42: {tx_hash}"); // Increment the number to 43. let builder = contract.increment(); let tx_hash = builder.send().await?.watch().await?; println!("Incremented number: {tx_hash}"); // Retrieve the number, which should be 43. let builder = contract.number(); let number = builder.call().await?.number.to_string(); println!("Retrieved number: {number}"); Ok(())
} 在 Github 上查找源代码 这里.

