运行此示例： 克隆 examples 仓库：git clone git@github.com:alloy-rs/examples.git 运行：cargo run --example unknown_return_types //! Example demonstrating how one can handle unknown / complex return types using `DynSol`. use alloy::{ contract::{ContractInstance, Interface}, dyn_abi::DynSolValue, json_abi::JsonAbi, network::{Ethereum, TransactionBuilder}, primitives::{hex, U256}, providers::{Provider, ProviderBuilder}, rpc::types::TransactionRequest, transports::http::{Client, Http},
};
use eyre::Result; #[tokio::main]
async fn main() -> Result<()> { let provider = ProviderBuilder::new().with_recommended_fillers().on_anvil_with_wallet(); let from = provider.get_accounts().await?[0]; let bytecode = hex::decode( // contract Colors { // struct Color { // uint8 r; // uint8 g; // uint8 b; // } // // mapping(address => Color) public colors; // // function setColor(uint8 r, uint8 g, uint8 b) public { // colors[msg.sender] = Color(r, g, b); // } // // function getColor(address user) public view returns (Color memory) { // return colors[user]; // } // // function getColorAsTuple( // address user // ) public view returns (uint8, uint8, uint8) { // return (colors[user].r, colors[user].g, colors[user].b); // } // } "" )?; let deploy_tx = TransactionRequest::default().from(from).with_deploy_code(bytecode); let contract_address = provider .send_transaction(deploy_tx) .await? .get_receipt() .await? .contract_address .expect("Failed to get contract address"); // Get the contract abi. let path = std::env::current_dir()?.join("examples/contracts/examples/abi/Colors.json"); let contents = std::fs::read(path)?; let abi: JsonAbi = serde_json::from_slice(&contents)?; // Create a new `ContractInstance` of the Counter contract from the abi. let counter_instance: ContractInstance<Http<Client>, _, Ethereum> = ContractInstance::new(contract_address, provider.clone(), Interface::new(abi)); // Interact with the contract. assert_eq!(counter_instance.abi().functions().count(), 4); // Set color to white. let r = DynSolValue::Uint(U256::from(255), 8); // uint8 let g = DynSolValue::Uint(U256::from(255), 8); // uint8 let b = DynSolValue::Uint(U256::from(255), 8); // uint8 let set_color_func = counter_instance.function("setColor", &[r, g, b])?; let set_color_receipt = set_color_func.send().await?.get_receipt().await?; assert!(set_color_receipt.status()); // Get the color. let get_color_func = counter_instance.function("getColor", &[DynSolValue::Address(from)])?; let get_color_result = get_color_func.call().await?; // The `r`, `g`, `b` values in the `Color` struct get converted to a `DynSolValue::Tuple`. assert!(get_color_result.len() == 1); for value in get_color_result { if let DynSolValue::Tuple(struct_as_tuple) = value { println!("{struct_as_tuple:?}"); } } // Get the color as tuple. let get_color_tuple = counter_instance.function("getColorAsTuple", &[DynSolValue::Address(from)])?; let get_color_tuple_result = get_color_tuple.call().await?; // The `r`, `g`, `b` are returned as a solidity tuple and hence represented as individual // `DynSolValue::Uint`. assert!(get_color_tuple_result.len() == 3); for value in get_color_tuple_result { println!("{value:?}"); } Ok(())
} 在 Github 上找到源码 here。

