};
use eyre::Result;
use futures_util::StreamExt;
use std::str::FromStr; // Codegen from embedded Solidity code and precompiled bytecode.
// solc v0.8.26; solc EventMultiplexer.sol --via-ir --optimize --bin
sol!( #[allow(missing_docs)] #[sol(rpc, bytecode = "")] contract EventMultiplexer { event Add(address indexed sender, int256 indexed value); event Sub(address indexed sender, int256 indexed value); event Mul(address indexed sender, int256 indexed value); event Div(address indexed sender, int256 indexed value); function add(int256 a, int256 b) public { emit Add(msg.sender, a + b); } function sub(int256 a, int256 b) public { emit Sub(msg.sender, a - b); } function mul(int256 a, int256 b) public { emit Mul(msg.sender, a * b); } function div(int256 a, int256 b) public { emit Div(msg.sender, a / b); } }
); #[tokio::main]
async fn main() -> Result<()> { // Spin up a local Anvil node. // Ensure `anvil` is available in $PATH. let anvil = Anvil::new().block_time(1).try_spawn()?; // Create a provider. let ws = WsConnect::new(anvil.ws_endpoint()); let provider = ProviderBuilder::new().on_ws(ws).await?; // Deploy the `EventExample` contract. let contract = EventMultiplexer::deploy(provider).await?; println!("Deployed contract at: {}", contract.address()); // Create filters for each event. let add_filter = contract.Add_filter().watch().await?; let sub_filter = contract.Sub_filter().watch().await?; let mul_filter = contract.Mul_filter().watch().await?; let div_filter = contract.Div_filter().watch().await?; let a = I256::from_str("1")?; let b = I256::from_str("1")?; // Build the transaction calls. let add_call = contract.add(a, b); let sub_call = contract.sub(a, b); let mul_call = contract.mul(a, b); let div_call = contract.div(a, b); // Send the transaction calls. let _ = add_call.send().await?; let _ = sub_call.send().await?; let _ = mul_call.send().await?; let _ = div_call.send().await?; // Convert the filters into streams. let mut add_stream = add_filter.into_stream(); let mut sub_stream = sub_filter.into_stream(); let mut mul_stream = mul_filter.into_stream(); let mut div_stream = div_filter.into_stream(); let add_log = &EventMultiplexer::Add::SIGNATURE_HASH; let sub_log = &EventMultiplexer::Sub::SIGNATURE_HASH; let mul_log = &EventMultiplexer::Mul::SIGNATURE_HASH; let div_log = &EventMultiplexer::Div::SIGNATURE_HASH; // Use tokio::select! to multiplex the streams and capture the log // tokio::select! will return the first event that arrives from any of the streams // The for loop helps capture all the logs. for _ in 0..4 { let log = tokio::select! { Some(log) = add_stream.next() => { log?.1 } Some(log) = sub_stream.next() => { log?.1 } Some(log) = mul_stream.next() => { log?.1 } Some(log) = div_stream.next() => { log?.1 } }; let topic = &log.topics()[0]; if topic == add_log { println!("Received Add: {log:?}"); } else if topic == sub_log { println!("Received Sub: {log:?}"); } else if topic == mul_log { println!("Received Mul: {log:?}"); } else if topic == div_log { println!("Received Div: {log:?}"); } } Ok(())
} 可以在 Github 上找到源代码 here.

