} fn get_usd_value(amount: u128, price_usd: U256) -> Result<f64> { let base = U256::from(10).pow(U256::from(ETH_DECIMALS)); let value = U256::from(amount) * price_usd / base; let formatted = format_units(value, ETH_USD_FEED_DECIMALS)?.parse::<f64>()?; Ok(formatted)
