use eyre::Result; // The address of the contract below deployed to Arbitrum Sepolia.
const COUNTER_CONTRACT_ADDRESS: Address = address!("d62FC4aB418580919F22E2aC3A0D93F832A95E70"); sol! { #[allow(missing_docs)] #[sol(rpc)] contract Counter { uint256 public number; function setNumber(uint256 newNumber) public { number = newNumber; } function increment() public { number++; } }
} #[derive(Debug, serde::Deserialize)]
struct ArbOtherFields { #[serde(rename = "gasUsedForL1")] gas_used_for_l1: U128, #[serde(rename = "l1BlockNumber")] l1_block_number: U64,
} #[tokio::main]
async fn main() -> Result<()> { // [RISK WARNING! Writing a private key in the code file is insecure behavior.] // The following code is for testing only. Set up signer from private key, be aware of danger. let signer: PrivateKeySigner = "<PRIVATE_KEY>".parse().expect("should parse private key"); let wallet = EthereumWallet::from(signer); let rpc_url = "https://sepolia-rollup.arbitrum.io/rpc".parse()?; let provider = ProviderBuilder::new() .with_recommended_fillers() .network::<AnyNetwork>() .wallet(wallet) .on_http(rpc_url); let contract = Counter::new(COUNTER_CONTRACT_ADDRESS, &provider); let builder = contract.setNumber(U256::from(42)); let receipt = builder.send().await?.get_receipt().await?; let arb_fields: ArbOtherFields = receipt.other.deserialize_into()?; let l1_gas = arb_fields.gas_used_for_l1.to::<u128>(); let l1_block_number = arb_fields.l1_block_number.to::<u64>(); println!("Gas used for L1: {}", l1_gas); println!("L1 block number: {}", l1_block_number); Ok(())
