`TransactionBuilder` 是一个用于特定网络的交易构建器，可通过 `.with_*` 方法进行配置。 常见的可配置字段包括： with_from with_to with_nonce with_chain_id with_value with_gas_limit with_max_priority_fee_per_gas with_max_fee_per_gas 通常推荐使用构建者模式，如下所示，而不是直接设置值（相比于 set_to，使用 with_to）。 //! 展示如何使用 `TransactionBuilder` 构建交易的示例 use alloy::{ network::TransactionBuilder, node_bindings::Anvil, primitives::U256, providers::{Provider, ProviderBuilder}, rpc::types::TransactionRequest,
};
use eyre::Result; #[tokio::main]
async fn main() -> Result<()> { // Spin up a local Anvil node. // Ensure `anvil` is available in $PATH. let anvil = Anvil::new().try_spawn()?; // Create a provider. let rpc_url = anvil.endpoint().parse()?; let provider = ProviderBuilder::new().on_http(rpc_url); // Create two users, Alice and Bob. let alice = anvil.addresses()[0]; let bob = anvil.addresses()[1]; // Build a transaction to send 100 wei from Alice to Bob. // The `from` field is automatically filled to the first signer's address (Alice). let tx = TransactionRequest::default() .with_to(bob) .with_nonce(0) .with_chain_id(anvil.chain_id()) .with_value(U256::from(100)) .with_gas_limit(21_000) .with_max_priority_fee_per_gas(1_000_000_000) .with_max_fee_per_gas(20_000_000_000); // Send the transaction and wait for the broadcast. let pending_tx = provider.send_transaction(tx).await?; println!("Pending transaction... {}", pending_tx.tx_hash()); // Wait for the transaction to be included and get the receipt. let receipt = pending_tx.get_receipt().await?; println!( "Transaction included in block {}", receipt.block_number.expect("Failed to get block number") ); assert_eq!(receipt.from, alice); assert_eq!(receipt.to, Some(bob)); Ok(())
} 建议在 ProviderBuilder 上使用 .with_recommended_fillers() 方法，该方法会自动为你 填充字段 。

