sol! 过程宏解析 Solidity 语法以生成实现了 alloy-sol-types 特性的类型。它使用 syn-solidity，一个基于 syn 的 Solidity 解析器。它旨在模仿官方 Solidity 编译器 (solc) 在解析有效 Solidity 代码时的行为。这意味着所有 solc 0.5.0 及以上版本认可的有效 Solidity 代码都被支持。 在最基本的形式下，sol! 是这样使用的： use alloy::{primitives::U256, sol}; // 用标准 Solidity 声明一个 Solidity 类型
sol! { struct Foo { uint256 bar; bool baz; }
} // 一个对应的 Rust 结构体被生成了！ // pub struct Foo {
// pub bar: Uint<256, 4>,
// pub baz: bool,
// } let foo = Foo { bar: U256::from(42), baz: true };

