有多种使用 sol! 宏的方法。 你可以直接编写 Solidity 代码： sol! { contract Counter { uint256 public number; function setNumber(uint256 newNumber) public { number = newNumber; } function increment() public { number++; } }
} 或者提供一个 Solidity 文件的路径： sol!( #[sol(rpc)] Counter, "artifacts/Counter.json"
); 另外，如果你启用了 json 特性标志，你可以提供一个 ABI，或者是一个 JSON 格式的路径： sol!( ICounter, r#"[ { "type": "function", "name": "increment", "inputs": [], "outputs": [], "stateMutability": "nonpayable" }, { "type": "function", "name": "number", "inputs": [], "outputs": [ { "name": "", "type": "uint256", "internalType": "uint256" } ], "stateMutability": "view" }, { "type": "function", "name": "setNumber", "inputs": [ { "name": "newNumber", "type": "uint256", "internalType": "uint256" } ], "outputs": [], "stateMutability": "nonpayable" } ]"#
); 这与以下内容相同： sol! { interface ICounter { uint256 public number; function setNumber(uint256 newNumber); function increment(); }
} 另外，你也可以通过文件加载一个 ABI： sol!( ICounter, "abi/Counter.json"
); 你也可以直接使用函数： sol!( function swapExactTokensForTokens( uint256 amountIn, uint256 amountOutMin, address[] calldata path, address to, uint256 deadline ) external returns (uint256[] memory amounts);
); println!("解码 https://etherscan.io/tx/0xd1b449d8b1552156957309bffb988924569de34fbf21b51e7af31070cc80fe9a"); let input = hex::decode("")?; // 使用生成的 `swapExactTokensForTokens` 绑定解码输入。
