结合 sol! 宏的 #[sol(rpc)] 属性， CallBuilder 可以用来与链上合约进行交互。#[sol(rpc)] 属性为合约中的每个函数生成一个方法，该方法返回该函数的 CallBuilder。 如果提供了 #[sol(bytecode = "0x...")]，合约可以通过 Counter::deploy 部署，并会创建一个新实例。 //! 示例展示如何使用 `#[sol(rpc)]` 和 #[sol(bytecode = "0x...")] 属性
//! interacting with it. use alloy::{ network::EthereumWallet, node_bindings::Anvil, primitives::U256, providers::ProviderBuilder, signers::local::PrivateKeySigner, sol,
};
use eyre::Result; // Codegen from embedded Solidity code and precompiled bytecode.
sol! { #[allow(missing_docs)] // solc v0.8.26; solc Counter.sol --via-ir --optimize --bin #[sol(rpc, bytecode="")] contract Counter { uint256 public number; function setNumber(uint256 newNumber) public { number = newNumber; } function increment() public { number++; } }
} #[tokio::main]
async fn main() -> Result<()> { // Spin up a local Anvil node. // Ensure `anvil` is available in $PATH. let anvil = Anvil::new().try_spawn()?; // Set up signer from the first default Anvil account (Alice). let signer: PrivateKeySigner = anvil.keys()[0].clone().into(); let wallet = EthereumWallet::from(signer); // Create a provider with the wallet. let rpc_url = anvil.endpoint().parse()?; let provider = ProviderBuilder::new().with_recommended_fillers().wallet(wallet).on_http(rpc_url); println!("Anvil running at `{}`", anvil.endpoint()); // Deploy the `Counter` contract. let contract = Counter::deploy(&provider).await?; println!("Deployed contract at address: {}", contract.address()); let builder = contract.setNumber(U256::from(42)); let tx_hash = builder.send().await?.watch().await?; println!("Set number to 42: {tx_hash}"); // Increment the number to 43. let builder = contract.increment(); let tx_hash = builder.send().await?.watch().await?; println!("Incremented number: {tx_hash}"); // Retrieve the number, which should be 43. let builder = contract.number(); let number = builder.call().await?.number.to_string(); println!("Retrieved number: {number}"); Ok(())
}

